import QuoteForm from "../components/quotes/QuoteForm";

const NewQuote = ()=>{

    const history = useHistory();
    const addQuoteHandler = quoteData =>{
        console.log(quoteData);
        history.push('/quotes');

    };
    return(
        <QuoteForm onAddQuote ={addQuoteHandler} />
    );
};

export default NewQuote;
